import React from 'react';
import Form from "./components/form"

const App = () => {
  const formData = (data) => {
    return (
      <div>
        <h1>{data.name}</h1>
        <p>{data.age}</p>
        <p>{data.number}</p>
      </div>
    )
  }


  return (
    <div>
      <h2>Welcome</h2>
      <Form onData={formData}/>

    </div>
  );
}

export default App;
